import React, { useState, useEffect } from "react";
import { AiOutlineVerticalAlignBottom } from "react-icons/ai";
import './paitentslist.css';

function PaientsList() {
  const url = "https://619f39821ac52a0017ba467e.mockapi.io/patientDetails";
  const [person, setPerson] = useState({});
  useEffect(() => {
    fetch(url)
      .then((res) => res.json())
      .then((res) => setPerson(res[0]));
  }, []);

  return (
    <>
      <div className=" flex-container">
        <div className="flex-item flexbox-item-1">
        <div className="box1">
          <h2 >{person.name}</h2>
        </div>
        <div className="ans">
        <div className="box2">
          <b id="box">{person.Past} </b>
          <span id="past">Past</span>
        </div>
        <div className="box3">
          <b id="upcome">{person.Upcoming}</b>
          <span id="box5">Upcoming</span>
        </div>
        </div>
        </div>
      </div>
    </>
  );
}

export default PaientsList;
